import React, { Component } from 'react'
import Header from '../components/Header.js'
import toast from '../assets/toast.png'
import raisins from '../assets/raisins.png'

class Home extends Component{
  render(){
    return(
      <React.Fragment>
        <Header />
        <div id="home-body">
          <img src={ toast } alt="Close up of a cat nose" id="toast"/>
          <img src={ raisins } alt="Close up of a cat nose" id="raisins"/>
        </div>
      </React.Fragment>
    )
  }
}
export default Home
